exports=async function(bid,options){const{parseCatalog,hrefRecordRegex,cleanCatalogWrapper}=await require("transcode/parse_catalog");return parseCatalog(`https://www.daoyouge.net/${bid}/index.html`,{cleaner:html=>cleanCatalogWrapper(html,/class="chapterlist"[^>]*>/,"</ul>").subIndexOf("<ul>"),recordRegex:hrefRecordRegex},{clientOptions:{...(options&&options.clientOptions)}})};